import React, { useState } from "react";
import './App.css';

function App() {

  const [query, setQuery] = useState([]);
  const [results, setResults] = useState([]);

  const clickHandler = (event) => {
    event.preventDefault();
    console.log("Toimii");
    HaeLeffaData();
  };
//CORS pit채채 olla selaimessa sallittu, muuten ei toimi.
  const HaeLeffaData = () => {
    fetch("https://fullstack-project2.onrender.com/api/leffat")
      .then((results) => {
        return results.json();
      })
      .then((data) => {
        console.log(data);
        const items = data;
        setResults(items)
      });
  };

  const LeffaArray = (props) => {
     return (
      <>
        <p>{props.title}</p>
      </>
     )
  }

  return (
    <div>
      <h1>Testing...</h1>
      <p>More testing....</p>
      <button type="button" className="btn" onClick={clickHandler}>
        Hae leffat
      </button>
      {query.map((data, index) => <LeffaArray title={data.title} />)}
    </div>
  );
}

export default App;
